import React from "react";
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

let path =
function Dialog_item(props) {
    return (
        <div className={s.dialogs}>
            <NavLink to={"/dialogs/" + props.id} activeClassName={s.active}>{props.name}</NavLink><br/>
        </div>
    )
}

function Dialogs() {
    return (
        <div className={s.content}>
            <div className={s.dialogs}>
                <h1>Dialogs</h1>
                <Dialog_item id="1" name="Yaroslav"/>
                <Dialog_item id="2" name="Alex"/>
                <Dialog_item id="3" name="Veronika"/>
                <Dialog_item id="4" name="Naruto"/>
                <Dialog_item id="5" name="Tanjiro"/>
                <Dialog_item id="6" name="Kaneki"/>
            </div>
            <div className={s.messages}>
                Hello
                hello
            </div>
        </div>
    )
}

export default Dialogs;
